<script>
	import Vue from 'vue';
	import {
		mapGetters, mapMutations
	} from "vuex";
	import mSocket from '@/common/socket/index.js';
	export default {
		onLaunch: function() {
			console.log('App Launch');
			
			uni.getSystemInfo({
				success: function(e) {
					// console.log(e)
					// #ifndef MP
					Vue.prototype.StatusBar = e.statusBarHeight;
					if (e.platform == 'android') {
						Vue.prototype.CustomBar = e.statusBarHeight + 50;
					} else {
						Vue.prototype.CustomBar = e.statusBarHeight + 45;
					};
					// #endif

					// #ifdef MP-WEIXIN
					Vue.prototype.StatusBar = e.statusBarHeight;
					let custom = wx.getMenuButtonBoundingClientRect();
					Vue.prototype.Custom = custom;
					Vue.prototype.CustomBar = custom.bottom + custom.top - e.statusBarHeight;
					// #endif		

					// #ifdef MP-ALIPAY
					Vue.prototype.StatusBar = e.statusBarHeight;
					Vue.prototype.CustomBar = e.statusBarHeight + e.titleBarHeight;
					// #endif
					Vue.prototype.SystemInfo = {
						platform: e.platform,
						windowWidth: e.windowWidth,
						windowHeight: e.windowHeight,
						screenWidth: e.screenWidth,
						screenHeight: e.screenHeight
					}
				}
			})
			// 判断app接下来的入口
			let storageInfo = uni.getStorageInfoSync();
			if (storageInfo.keys.indexOf('token') != -1) {
				uni.getStorage({
					key: 'token',
					success: (res) => {
						this.changeVal({
							stateKey: 'token',
							newValue: res.data
						});
						this.initSocket();
						if (storageInfo.keys.indexOf('firstPerfectInfo') != -1 && uni.getStorageSync('firstPerfectInfo')) {
							// 一般直接进入首页-home/index;
							uni.redirectTo({
								url: 'pages/home/index',
							})
						} else {
							uni.redirectTo({
								url: 'pages/initial/personaldata',
							})
						}
					}
				})
			} else {
				uni.redirectTo({
					url: 'pages/initial/wxoauth',
				})
			}
		},
		onShow: function() {
			// 连接socket;
			this.globalData.socket.initSocket();
		},
		onHide: function() {

		},
		computed: {
			...mapGetters(['token'])
		},
		methods: {
			...mapMutations(['changeVal']),
			initSocket() {
				let self = this;
				console.log(self.token);
				let socket = new mSocket({
					url: 'wss://api.meetu.letwx.com/im?token='+self.token,
					timeout: 30000,
					isSendHeart: true,
					heartData: {"msgType":"ping","data":{}},
					isReconnection: true,
					reConnectTime: 3000,
					debug: process.env.NODE_ENV === "development",
					params: { // 发送消息时如果时json则自动加上组合里面参数
						// token: token
					},
					onSocketOpen: header => {},
					onSocketMessage: data => {
						self.$store.dispatch('setSocketState', data);
					},
					onSocketError: res => {
						self.$store.dispatch('setSocketStateErr', res.errMsg);
					},
					onSocketClose: res => {}
				});
				this.globalData.socket = socket;
			}
		},
		globalData: {
			sendSignal: false,
			socket: null,
		}
	}
</script>

